  category_name TEXT
);

CREATE TABLE blueprints (
    id INT PRIMARY KEY,
    blueprint_name VARCHAR(255) NOT NULL,
    architect_name VARCHAR(255),
    creation_date DATE
);

CREATE TABLE rooms (
    room_id INT PRIMARY KEY,
    room_name VARCHAR(255) NOT NULL,
    room_size INT,
    room_type VARCHAR(50)
);

